import React, { useEffect, useState } from 'react';
import '../styles/navbar.css';

const Navbar = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    const status = localStorage.getItem('isLoggedIn') === 'true';
    setIsLoggedIn(status);
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('isLoggedIn');
    // Hapus cookie juga kalau pakai Google OAuth dan backend session
    window.location.href = '/login'; // atau reload page
  };

  return (
    <nav className="navbar">
      <div className="logo">Tikeroo</div>
      <ul className="menu">
        <li>Musik</li>
        <li>Olahraga</li>
        <li>Wisata</li>
        <li>Kuliner</li>
        <li>Teater</li>
        <li>Seminar</li>
      </ul>
      <div className="auth-buttons">
        {isLoggedIn ? (
          <>
            <span className="welcome-msg">Selamat datang!</span>
            <button className="btn" onClick={handleLogout}>Keluar</button>
          </>
        ) : (
          <>
            <button className="btn" onClick={() => window.location.href = '/register'}>Daftar</button>
            <button className="btn" onClick={() => window.location.href = '/login'}>Masuk</button>
          </>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
